import React from 'react';
import { withRouter } from 'react-router-dom';
import Header from './Header';

class Login extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            email: '',
            password: ''
        };
    }

    render() {
        return (
            <Header />
        );
    }
}

export default withRouter(Login);
